import React, { useState, useEffect } from 'react';
import api from '../services/api';

const AllSubscriptions = () => {
  const [subscriptions, setSubscriptions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchSubscriptions = async () => {
      try {
        const response = await api.get('/subscriptions/all');
        setSubscriptions(response.data);
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch all subscriptions');
        setLoading(false);
      }
    };

    fetchSubscriptions();
  }, []);

  if (loading) return <div className="loading">Loading subscriptions...</div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="all-subscriptions">
      <h2>All Subscriptions</h2>
      <table className="subscriptions-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>User</th>
            <th>Plan</th>
            <th>Start Date</th>
            <th>End Date</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {subscriptions.map((subscription) => (
            <tr key={subscription.id}>
              <td>{subscription.id}</td>
              <td>{subscription.username}</td>
              <td>{subscription.plan_name}</td>
              <td>{new Date(subscription.start_date).toLocaleDateString()}</td>
              <td>{new Date(subscription.end_date).toLocaleDateString()}</td>
              <td className={subscription.is_active ? 'active' : 'inactive'}>
                {subscription.is_active ? 'Active' : 'Inactive'}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AllSubscriptions;
